import React from 'react';
import { Button, Avatar, Spacer } from '@geist-ui/react';
import {
  ProfileContainer,
  ProfileHeader,
  IconContainer,
  Form,
} from '../Profile';
import { TextMedium16, TextSemi20, HeaderText } from '../../utils';

function Profile() {
  return (
    <ProfileContainer>
      <HeaderText text='Profile' />
      <ProfileHeader>
        <div className='profile-header'>
          <div className='profile-header__left'>
            <div className='profile-header__meta'>
              <div className='profile-header__meta-image'>
                <Avatar
                  src='https://images.unsplash.com/photo-1570295999919-56ceb5ecca61?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80'
                  size='large'
                  isSquare={true}
                />
              </div>

              <div className='profile-header__meta-name'>
                <TextSemi20>Koushith</TextSemi20>
                <Spacer y={0.2} />
                <TextMedium16>0x337b2aF19e840E8...</TextMedium16>
              </div>
            </div>
          </div>

          <div className='profile-header__right'>
            <Button auto className='btn btn-primary'>
              {' '}
              Edit Profile
            </Button>
          </div>
        </div>
        <IconContainer>fff</IconContainer>
      </ProfileHeader>

      {/* form section */}

      <Form>
        <h1>fhfh</h1>
      </Form>
    </ProfileContainer>
  );
}

export default Profile;
